export class HospitalisationDepuitLaDernierVisite {
    hospitalisationId: number;
    idVisite: number;
    hospitalisation: boolean;
    date: string;
    dureeHospitalisation: number;
    lieuHospitalisation: string;
    diagnostic: string;
    traitementRecu: string;
    evolution: string;

    constructor() {
        this.hospitalisationId = 0;
        this.idVisite = 0;
        this.hospitalisation = false;
        this.date = '';
        this.dureeHospitalisation = 0;
        this.lieuHospitalisation = '';
        this.diagnostic = '';
        this.traitementRecu = '';
        this.evolution = '';
    }
}
